$_MODULE['<{paypal}prestashop>sectionbraintreecredentials_d137f37fc8a46818c15c2bccc8d727db'] = '-Masz klucze API, jeśli je wcześniej zapisałeś, i nadal przyjmujesz płatności przez Braintree, jeśli twoje konto jest już poprawnie skonfigurowane. Po twojej stronie nie są wymagane żadne działania.';
$_MODULE['<{paypal}prestashop>sectionbraintreecredentials_f47003b97fae0faa5ba397559d48d202'] = '[b]Chcesz zmienić konfigurację konta, ale nie możesz uzyskać kluczy API:[/b]';
$_MODULE['<{paypal}prestashop>sectionbraintreecredentials_f237d0ecec61e571ff21e296c183f44a'] = '- Jeśli nie przechowujesz kluczy interfejsu API gdzieś po swojej stronie, nie będziesz już mógł korzystać z poświadczeń interfejsu API bieżącego konta, ponieważ nie możemy ich dostarczyć. Jeśli chcesz nadal korzystać z obecnego modułu PrestaShop Braintree, który wymaga kluczy API, musisz złożyć wniosek o konto Braintree Direct, klikając przycisk „Zarejestruj się” u dołu strony głównej Braintree. Po zatwierdzeniu nowego konta będzie można zalogować się i pobrać klucze API. Jeśli masz jakiekolwiek problemy z procesem zatwierdzania przez Braintree, skontaktuj się z pomocą techniczną Braintree na ich stronie internetowej.';
